import React from 'react'

export default function profileDetails() {
    const style = {
        margin:'0px',padding:'0px'
    }
    return (
        <div>
            <h2 style={style}>Ricky Hernandez</h2>
            <h5 style={style}>Software Developer</h5>
            <span >Phone: <span>760-421-1563</span> </span>
            <span>Email: <span>Rickyhonline@gmail.com</span></span>
            <span>Adress: <span>3305 Poppy Hills Lane, Encintias CA</span></span>
        </div>
    )
}
